                                else
                                    VIP = Inst[3]
                                end
                            else
                                Stk[Inst[2]] = Stk[Inst[3]] - Inst[4]
                            end
                        elseif Enum <= 107 then
                            if Enum > 106 then
                                Stk[Inst[2]] = Stk[Inst[3]] / Inst[4]
                            else
                                Stk[Inst[2]] = Wrap(Proto[Inst[3]], nil, Env)
                            end
                        elseif Enum == 108 then
                            local A = Inst[2]
                            local T = Stk[A]
                            for Idx = A + 1, Inst[3] do
                                Insert(T, Stk[Idx])
                            end
                        else
                            Stk[Inst[2]] = Inst[3] / Inst[4]
                        end
                    elseif Enum <= 113 then
                        if Enum <= 111 then
                            if Enum > 110 then
                                local A = Inst[2]
                                local Cls = {}
                                for Idx = 1, #Lupvals do
                                    local List = Lupvals[Idx]
                                    for Idz = 0, #List do
                                        local Upv = List[Idz]
                                        local NStk = Upv[1]
                                        local DIP = Upv[2]
                                        if (NStk == Stk) and (DIP >= A) then
                                            Cls[DIP] = NStk[DIP]
                                            Upv[1] = Cls
                                        end
                                    end
                                end
                            else
                                Env[Inst[3]] = Stk[Inst[2]]
                            end
                        elseif Enum > 112 then
                            if Stk[Inst[2]] ~= Stk[Inst[4]] then
                                VIP = VIP + 1
                            else
                                VIP = Inst[3]
                            end
                        else
                            local A = Inst[2]
                            Stk[A] = Stk[A](Unpack(Stk, A + 1, Inst[3]))
                        end
                    elseif Enum <= 115 then
                        if Enum == 114 then
                            Stk[Inst[2]] = -Stk[Inst[3]]
                        elseif not Stk[Inst[2]] then
                            VIP = VIP + 1
                        else
                            VIP = Inst[3]
                        end
                    elseif Enum <= 116 then
                        local A = Inst[2]
                        local Step = Stk[A + 2]
                        local Index = Stk[A] + Step
                        Stk[A] = Index
                        if Step > 0 then
                            if Index <= Stk[A + 1] then
                                VIP = Inst[3]
                                Stk[A + 3] = Index
                            end
                        elseif Index >= Stk[A + 1] then
                            VIP = Inst[3]
                            Stk[A + 3] = Index
                        end
                    elseif Enum > 117 then
                        local A = Inst[2]
                        Stk[A] = Stk[A](Unpack(Stk, A + 1, Top))
                    else
                        Stk[Inst[2]] = Stk[Inst[3]] - Stk[Inst[4]]
                    end
                elseif Enum <= 127 then
                    if Enum <= 122 then
                        if Enum <= 120 then
                            if Enum == 119 then
                                local NewProto = Proto[Inst[3]]
                                local NewUvals
                                local Indexes = {}
                                NewUvals = Setmetatable({}, {
                                    __index = function(_, Key)
                                        local Val = Indexes[Key]
                                        return Val[1][Val[2]]
                                    end,
                                    __newindex = function(_, Key, Value)
                                        local Val = Indexes[Key]
                                        Val[1][Val[2]] = Value
                                    end,
                                })
                                for Idx = 1, Inst[4] do
                                    VIP = VIP + 1
                                    local Mvm = Instr[VIP]
                                    if Mvm[1] == 14 then
                                        Indexes[Idx - 1] = { Stk, Mvm[3] }
                                    else
                                        Indexes[Idx - 1] = { Upvalues, Mvm[3] }
                                    end
                                    Lupvals[#Lupvals + 1] = Indexes
                                end
                                Stk[Inst[2]] = Wrap(NewProto, NewUvals, Env)
                            else
                                Stk[Inst[2]]()
                            end
                        elseif Enum == 121 then
                            local A = Inst[2]
                            local T = Stk[A]
                            local B = Inst[3]
                            for Idx = 1, B do
                                T[Idx] = Stk[A + Idx]
                            end
                        else
                            Stk[Inst[2]] = Stk[Inst[3]] + Stk[Inst[4]]
                        end
                    elseif Enum <= 124 then
                        if Enum == 123 then
                            local A = Inst[2]
                            local T = Stk[A]
                            for Idx = A + 1, Top do
                                Insert(T, Stk[Idx])
                            end
                        else
                            Stk[Inst[2]] = Stk[Inst[3]][Stk[Inst[4]]]
                        end
                    elseif Enum <= 125 then
                        local A = Inst[2]
                        Stk[A] = Stk[A](Stk[A + 1])
                    elseif Enum > 126 then
                        Stk[Inst[2]] = Stk[Inst[3]] - Stk[Inst[4]]
                    else
                        local A = Inst[2]
                        Stk[A](Stk[A + 1])
                    end
                elseif Enum <= 131 then
                    if Enum <= 129 then
                        if Enum > 128 then
                            Stk[Inst[2]][Stk[Inst[3]]] = Inst[4]
                        else
                            Stk[Inst[2]][Stk[Inst[3]]] = Inst[4]
                        end
                    elseif Enum == 130 then
                        Stk[Inst[2]]()
                    else
                        Stk[Inst[2]] = Stk[Inst[3]] % Inst[4]
                    end
                elseif Enum <= 133 then
                    if Enum == 132 then
                        Stk[Inst[2]] = Inst[3] / Inst[4]
                    else
                        Stk[Inst[2]] = Wrap(Proto[Inst[3]], nil, Env)
                    end
                elseif Enum <= 134 then
                    local A = Inst[2]
                    Stk[A](Stk[A + 1])
                elseif Enum > 135 then
                    local A = Inst[2]
                    local Results, Limit = _R(Stk[A](Stk[A + 1]))
                    Top = (Limit + A) - 1
                    local Edx = 0
                    for Idx = A, Top do
                        Edx = Edx + 1
                        Stk[Idx] = Results[Edx]
                    end
                else
                    do
                        return Stk[Inst[2]]
                    end
                end
                VIP = VIP + 1
            end
        end
    end
    return Wrap(Deserialize(), {}, vmenv)(...)
